import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import PaperComponent1 from "../components/Paper1";
import Pic from "../img/paper1.jpg";

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    height: 'auto',
    '& > *': {
      width: '80%',
      margin: '3% auto 5% auto',
      color: '#383e56',
    },
  },
}));

export default function Paper1() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Paper
        elevation={20}
        children={
          <div>
            <div>
              <div className="row">
                <div className="col-7 paper-text-style">
                  <h1 className="paper-header">Mutter-Kind-Pass Gespräch</h1>
                  <hr className="hr-duck" />
                  <p>
                    Seit einigen Jahren hast du im Muttekindpass die Möglichkeit, neben den ärztlichen Untersuchungen, ein kostenloses Gespräch mit einer Hebamme zu führen.
                  </p>
                  <p>
                    Dieses Gespräch ist zwischen der 18. und 22. Schwangerschaftswoche vorgesehen und dauert eine Stunde.
                  </p>
                  <p>
                    Hier können zum Beispiel Themen wie Ernährung, Schwangerschaftsbeschwerden, die Wahl deines Geburtsortes oder Fragen zum Wochenbett besprochen werden.
                  </p>
                  <br />
                  <h3>
                    Kosten: 50 Euro, vollständig rückerstattbar
                  </h3>
                </div>
                <div className="col-5 paper-col-img-style">
                  <img src={Pic} alt="Probe" className="paper-img-style"/>
                </div>
              </div>
            </div>
          </div>
        }
      />
    </div>
  );
}
